INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(1, 'White Couch', 'No', 'Good', , 1, 'This beautiful couch is perfect for the family looking for a comfortable place to sit while enjoying games, movies, or having company over. The upholstery is like-new, with no stains and discoloration.', 69.99);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(2, 'Sun Valley Sandstone Gray 6 Piece Dining Room Set', 'Yes', 'Excellent', , 3, 'This 6 piece dining set is one to own! With its clean lines, stylish look and neutral finish, this set is a great addition to your home, especially if you are tight on space. Includes table, bench and four side chairs. ', 100.95);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(3, 'Chocolate Brown Patio Loveseat Glider', 'Yes', 'Excellent', , 4, 'Make the most out of summer with this chocolate brown patio loveseat glider. With an aluminum frame and weather proof mesh fabric, this glider is perfect for your outdoor living space.', 120.55);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(4, 'Mason Natural and Black Executive Desk', 'No', 'Good', , 5, 'Storage and style come easy with this executive desk! The natural wood grain is accented by the black framing and hardware. Keep your home office supplies organized with five utility drawers, two locking file cabinets, and a spacious desktop.', 450.55);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(5, 'Atwater Living Reeta Twin over Futon Metal Bunk Bed', 'No', 'Good', , 6, 'Versatile and trendy, the Reeta Twin over Futon Metal Bunk Bed grants all your wishes. It brings a modern industrial style with its sleek lines and metal frame while still ensuring the safety of your kids. Built with sturdy metal, full-length guardrails, metal slats, a ladder and a childproof mechanism for the futon, the Reeta is the exemplification of strong and durable.', 150.00);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(6, 'LG 26.2 cu ft French Door Refrigerator - Stainless Steel ', 'No', 'Good', , 2, 'Stock-up and store everything you need with this stainless steel LG French door refrigerator from RC Willey. With a cavernous 26 cubic feet of space, this LG French Door refrigerator gives you ample space for all of your family’s favorite foods and keeps them conveniently organized and within reach. The LG Stainless Steel Series combines stainless steel with a satin-smooth, sophisticated finish for a brilliantly appealing look that pairs beautifully with any style.', 150.00);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(7, 'Clonmel Gray Wide Seat Recliner ', 'No', 'Good', , 1, 'Add the ultimate comfort to your living room with the Clonmel collection wide recliner from RC Willey. The soft fabric and plushy cushions provide the ultimate seating for watching a movie or reading a book. With a corner blocked wood frame and metal reinforced seats, you know this recliner is built to last. ', 150.00),
(8, 'Orlando Farmhouse Sand and Black 5 Piece Dining Set', 'No', 'Good', , 3, 'A trestle base and clean lines are the hallmarks of this farmhouse sand and black 5 piece dining set, now at RC Willey! The sand and black finishes complement the look that will look fantastic in any dining area, especially an eat-in kitchen. The table measures 78\" providing plenty of space to seat six. ', 415.00);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(9, 'Jordan Black Jeep Twin Bed ', 'No', 'Good', , 7, 'The Jordan collection black Jeep twin bed will help your child ride the open terrain of their imagination in style and RC Willey has it! This fun and whimsical bed features a sleek, black finish adorned with realistic racing decals along the sides. Plus, its headlights actually light up! Its four tires complete the look, adding eye-catching detail and whimsy. Your child is sure to love the adventure and excitement this Jeep twin bed offers!', 215.56),
(10, 'Bicycle Unicycle Counter Height Stool ', 'No', 'Good', , 2, 'This one-of-a-kind 25\" unicycle counter height stool is sure to catch the eye of all who see it. Complete with old-fashioned metal pedals and a wide sturdy base, this counter stool will keep you perched in comfort and will have you feeling like a genuine top hat wearing unicycle rider at a county fair. Whether your home\'s style is traditional or contemporary you can incorporate this statement piece for some vintage flair. ', 90.99),
(11, 'Vapor Blue Gaming Chair ', 'No', 'Good', , 5, 'This Vapor Collection blue gaming chair is the perfect chair for gaming sessions both long and short. This chair features a modern design and is both stylish and functional. The adjustable chair height works for you, padded armrests, and lumbar support keeps you comfortable and free of distractions. Bring it home today and get in the game! ', 140.63);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(12, 'Metal Wicker Outdoor Hanging Chair with Cushion ', 'No', 'Good', , 4, 'Featuring a suspended design and metal wicker frame, this hanging patio chair from RC Willey is perfect for lounging in your outdoor patio area. Unwind this summer in a comfortable hanging chair with a weather-resistant cushion and pad. ', 300.00);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(13, 'Heartland Antique White Nightstand ', 'No', 'Good', , 6, 'The Heartland antique white nightstand at RC Willey beautifully blends a classic silhouette with country charm that results in an enduring, airy look you and your family are sure to love! This well designed piece features 1 drawer and 2 open shelves that help keep your bedside items organized and tidy. Constructed from rubberwood solids and cathedral oak veneers, its delightful antique white finish is artfully enhanced with a contrasting top. You\'ll adore its timeless design elements, convenient storage, and fresh, shabby-chic vibe that will effortlessly enhance your unique decorating style.', 190.55);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(14, 'Pleasanton Contemporary Wine Cabinet', 'No', 'Good', , 3, 'Add a chic contemporary appeal to your dining room with the Pleasanton wine cabinet. Its flawless, sturdy construction creates an organized piece that features five stemware racks, a center wine rack that holds up to seven standard sized bottles, and a bottom shelf for dinnerware. Two side cabinets open to reveal two more shelves for additional wine bottle or dinnerware storage.', 150.93),
(15, 'Gray and Walnut Wood Home Office Desk', 'No', 'Good', , 5, 'Create a beautiful workspace you can call your own with the Archer Desk by LumiSource for sale online at RC Willey. Featuring a walnut wood frame, grey wood top, this two-tier contemporary design is perfect for keeping your space organized and getting work done. Perfect for large or small spaces and available in a variety of finishes, choose the one that suits your space the best.', 125.99),
(16, 'Nash Rustic Gray Upholstered Dining Room Chair', 'No', 'Good', , 3, 'Upholstered for comfort and full of rustic charm, this dining room chair features a unique back design and clean lines. This chair features a durable upholstered seat and a sturdy build. Pair it with the Nash Collection dining table to complete the look.', 110.55);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(17, 'Domino Gray Reclining Loveseat with Console', 'No', 'Good', , 1, 'The Domino carbon gray dual reclining loveseat offers a relaxed contemporary vibe that your family will love. Its durable upholstery with exposed stitching and handsome silhouette lends its chic appeal. Plus, the center console features hidden storage and 2 convenient cupholders!', 200.91);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(18, 'Nash Rustic Gray Upholstered Dining Room Chair', 'No', 'Good', , 3, 'Upholstered for comfort and full of rustic charm, this dining room chair features a unique back design and clean lines. This chair features a durable upholstered seat and a sturdy build. Pair it with the Nash Collection dining table to complete the look.', 30.00);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(19, 'Avery Black 3 Piece Vanity Set', 'No', 'Good', , 6, 'Add a hint of glitz to your child\'s bedroom with the Avery 3-piece vanity set! Its chic, clean lines are finished in a bold obsidian black. It features 3 display drawers across the top and 3 storage drawers on both sides with a tempered glass top. The matching mirror with LED lights adds a touch of old Hollywood glamour! Plus, the black upholstered swivel stool adds even more style and function to the vanity set. ', 250.99),
(20, 'Tyler Gray Kid\'s Book and Toy Storage ', 'No', 'Good', , 6, 'Don’t fight with all the clutter of a child’s room, simply store away their toys and games in the Ameriwood Home Tyler Book and Toy Storage. This Toy Storage is great for storing stuffed animals, toys and books and includes curved corners for your child’s safety. Keep everything organized in the 2 large open compartments and display their favorite books on the top 3 shelves for easy access. Each bookshelf features a rod to keep books in place and allow easy access for kids. ', 50.00),
(21, 'Avery Loft Limestone Gray Sofa Table ', 'No', 'Good', , 1, 'The Avery Loft Collection modern sofa table from RC Willey comes in a limestone gray finish that looks great in your contemporary home. This console table features a unique S-shaped design with 2 cubby holes and asymmetrical shelves. This piece accents your minimal home. Place it in an entryway, hallway or behind a sofa for instant style. Display your favorite objects and photographs in a place worthy of them! ', 60.59);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(22, 'Olivia White 4-in-1 Convertible Crib ', 'No', 'Good', , 6, 'The Olivia 4-in-1 convertible crib\'s vintage styling and intricate spindle and molding detailing will create and elegant yet playful look for your child\'s room. Its sturdy construction and vintage white finish makes it an ideal option for those looking to add classic design to their nursery. And with the ability to easily convert into a toddler bed, day bed, and full size bed, it is sure to be a beautiful addition for years to come! ', 300.98),
(23, 'Modern Walnut Brown Chest of Drawers - South Shore', 'No', 'Good', , 6, 'Now at RC Willey, the Scandinavian-inspired Flam collection walnut brown and black chest of drawers will add a sleek, minimalist look to any bedroom space. Its clean lines, angled legs, and contrast molding create a warm, relaxing ambiance. The little details make all the difference—angled legs give the piece character, while the contrast molding highlights its clean lines. The 5 drawers featuring metal knobs and handles have metal slides that make them easy to open.', 250.96),
(24, 'Garrett Black Lift Top Coffee Table with Storage ', 'No', 'Good', , 1, 'Take your living room to new heights with this transitional black lift top coffee table available at RC Willey. Featuring an extremely functional design with the lift top, you will love the feel this table brings to your home. This piece includes plenty of storage space behind four sliding doors. With casters for easy mobility, this table will make an easy addition to your living room. ', 350.95);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(25, 'Grand Estates Brown and Glass Top Coffee Table  ', 'No', 'Good', , 1, 'Take your living room to new heights with this transitional black lift top coffee table available at RC Willey. Featuring an extremely functional design with the lift top, you will love the feel this table brings to your home. This piece includes plenty of storage space behind four sliding doors. With casters for easy mobility, this table will make an easy addition to your living room. ', 140.98),
(26, 'Danby Diplomat 7.0 cu ft Square Chest Freezer - White ', 'No', 'Good', , 2, 'Keep your bulk freezer items easily stored in this Danby Diplomat chest freezer! Storing up to 7 cu ft, this freezer is perfect for when you need that little bit of extra freezer space. This chest freezer comes garage ready and performs perfectly in garage temperatures ranging from 0F to 110F. The front-mounted thermostat and indicator light help you easily stay in control and monitor your frozen goods. ', 200.98),
(27, 'Frigidaire Professional 18.9 cu ft Upright Freezer - Stainless Steel', 'No', 'Good', , 2, 'Upgrade to an eye-catching built-in look with this beautiful single-door freezer from RC Willey. In addition, you can customize your kitchen with an optional trim kit and the ability to place a matching refrigerator with this freezer together. Or, depending on your kitchen you can have them separated. ', 210.95),
(28, 'Frigidaire 20 cu ft Upright Freezer - White', 'No', 'Good', , 2, 'This Frigidaire 20 cubic foot upright freezer includes a superior tight seal that locks in cold air, keeping food frozen for two days if there is a power outage. The EvenTemp Cooling System boasts a variable speed compressor that constantly circulates cold air throughout the freezer with smart sensing technology that adjusts airflow to maintain a uniform temperature. The flexible interior organization system enables you to easily organize your family\'s frozen favorites with four adjustable, full-width glass shelves, a deep bottom basket, and five spacious door bins. This upright freezer is perfect for keeping your family\'s extra frozen foods organized and ready for when you need them! ', 250.86);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(29, 'Macan Gray Cast Metal Patio Fire Pit with Accessories ', 'No', 'Good', , 4, 'This 52 inch round fire pit from RC Willey is part of the Macan Collection. This traditional fire pit features a classic patio design with a gray metal finish and comes with all necessary fire pit accessories—glass beads and fire pit cover. Get together this summer and enjoy conversations outside around a gas fire that offers real warmth, flame, and ambiance. ', 350.89),
(30, 'Sunset 6 Piece Patio Dining Set ', 'No', 'Good', , 4, 'The Sunset Collection 6 piece patio dining set from RC Willey comes with 4 armless chairs, a patio bench, and a generously sized rectangular patio table. There is always room for one more around this table! Gather together this summer and dine outside with your favorite people and make the most of the hottest season of the year. ', 400.89);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(31, 'Country White 72 Inch TV Stand ', 'Yes', 'Excellent', , 1, 'This country eggshell white 72 inch TV stand is another stunning piece from Parker House. The vintage finish will brighten up your room and give it a more open feel. And, the simple molding, tapered legs, and round metal knob hardware contribute to the modern country look of this beautiful piece of furniture. Not only does it look great, but this TV stand also blends a combination of storage options with drawers, shelves behind closed doors, and shelves behind open window framed doors. This combination gives you all that you need to hold your media components, remotes, and gaming devices.', 150.95),
(32, 'Loft Brown Entertainment Wall ', 'No', 'Good', , 1, 'Create the ultimate cozy TV-watching experience with this entertainment wall unit! The natural, weathered wood is accented by multiple color variations for a set that is truly unique. Keep family photos, home decor pieces, plants, and more along the spacious shelves. Media consoles, soundbars, and gaming systems can stay neatly tucked away in the enclosed drawers and glass-front cabinets. This all-in-one entertainment center makes it easy to upgrade your living room furniture! ', 400.99);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(33, 'Copper Ring Fire Pit - Yuma ', 'No', 'Good', , 4, 'add a unique flair to your outdoor gatherings with the copper ring outdoor fire pit from the Yuma collection. Constructed of durable steel, the Yuma features a tough, all-weather powder-coated finish. Its deep bowl design will hold plenty of wood, perfect for roasting marshmallows or swapping stories. Finished with a decorative copper-on-steel ring, the Yuma will be the centerpiece of your backyard memories for years to come. ', 100.89),
(34, 'Pure Modern Gray Buffet ', 'Yes', 'Excellent', , 3, 'The Pure Modern gray buffet has it all! Whether you need a prep area, storage space or just a gorgeous piece in your dining room, you\'ll get it. The top features onyx insets that allow you to prep and serve while having everything you need to do so at your fingertips as the ample storage drawers and shelves are right there. This cool buffet even has power so you can keep your food warm or blend up Friday night margaritas.', 150.00);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(35, 'Potomac Firepit Patio Table ', 'No', 'Good', , 4, 'Create the perfect relaxing atmosphere for your backyard with this firepit patio table from our Patomac collection! This firepit boasts an impressive 52,000 BTUs to keep you and your guests warm and toasty on cool nights. Keep drinks and snacks along the tabletop edge for parties that won\'t stop all summer long. Use this firepit table on its own, or pair it with the rest of our Patomac collection for a full patio furniture design! ', 180.96),
(36, 'Oxford Black Corner Curio Cabinet ', 'No', 'Good', , 3, 'The Oxford corner curio is a modern update on the traditional style cabinet with the unique incised semi-circles in the front glass. The lovely curio features four adjustable shelves and interior lighting making it the perfect way to present your most cherished pieces.', 100.69);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(37, 'Weathered White Curio Cabinet ', 'No', 'Good', , 2, 'The weathered white finish of this lovely curio will be a beautiful addition to your space! It has all the details that lend to a cozy cottage feel. Featuring a side opening, LED lights and a mirrored back that makes everything you display inside come to life. The adjustable shelves will allow you to show off pieces of all sizes and a plate grove will provide additional support if necessary.', 150.98),
(38, 'Sweet Beginnings Deluxe Bassinet', 'No', 'Good', , 7, 'Give your newborn a safe and comfortable place to sleep or rest with this classically styled Deluxe Sweet Beginnings Bassinet from Delta Children. It features a beautiful, modern, gender-neutral leaf fabric designed to match your existing décor, and an electronic module to help baby fall asleep with gentle lullabies and a soft nightlight. ', 50.65),
(39, 'Davidson Gray Casual Classic Triple Twin Bunk Bed ', 'No', 'Good', , 7, 'The Davidson grey triple twin bunk bed will take your child\'s room to a whole new level. Sturdy construction and clean, sleek lines make it a perfect option for those looking to maximize space and style. Its versatile, timeless, and convenient—a triple threat in more ways than one! ', 180.89);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(40, 'Rustic Sand Twin Loft Bed with Storage Drawers - Treehouse', 'No', 'Good', , 7, 'Add a whimsical design and convenient storage to your child\'s bedroom with the Treehouse rustic sand twin loft bed with storage drawer! This imaginative piece will add distinctive character, charm and fun to both playtime and bedtime. Its solid wood construction means this loft bed is built to last. The 2 included storage drawers make tidying up a breeze. Its airy finish is versatile and fresh.', 200.89),
(41, 'Middleton Beige 3 Piece Sectional', 'No', 'Good', , 1, 'The Middleton 3-piece sectional with right-facing chaise will add a chic, farmhouse casual vibe to your living spaces! Its generous dimensions and inviting and fresh cement beige color make it an ideal backdrop for entertaining friends and family. Comfort coil seating featuring Comfor-gel makes relaxing hard to resist. Pewter decorative nail-head trim along base, wooden pyramid legs, and an eclectic collection of toss pillows add to this sectional\'s enduring, stylish appeal.\r\n\r\nIncludes left-facing sectional sofa, armless sofa, and right-facing chaise', 350.98);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(42, 'Pueblo Rustic White Coffee Table ', 'No', 'Good', , 1, 'This antique white washed farmhouse coffee table will help you create a country getaway in your home. With a two-tone finish, metal mesh accents, and sliding barn-style doors, this piece is big on style and high on charm. Part of the Pueblo Collection, this cocktail table looks great on its own or paired with the matching end tables, sofa table, chairside table, and entertainment center! ', 60.96),
(43, 'Beach House Gray Chairside Table ', 'No', 'Good', , 1, 'This coastal-style chairside table will add storage to your living room without sacrificing style! The neutral gray finish is accented by natural wood grain details and black iron hardware for a pop of contrast. Keep remotes, manuals, and more in the upper drawer, while your favorite books can be organized below in the enclosed cabinet. Keep tablets, phones, laptops, and more charged with the convenient USB and three-pronged charging ports located under a lift flap at the back of the table. This side table stands strong on its own, but we think it would look best when paired with the rest of our Beach House collection! Upgrade your living room furniture today for a crisp, coastal home design. ', 49.99),
(44, 'Modern Eclectic Creamy White Three Piece Bar Set ', 'No', 'Good', , 3, 'This gorgeous 3 piece bar set is exactly what you\'ve been looking for! It has the perfect modern farmhouse vibe and will seamlessly complement any area of your home. Add it to the kitchen, family room or recreation area and you instantly have a place to serve drinks, hors d\'eouvres or just hang out with family and friends. With closed storage, bottle storage and open shelves, it has everything you need for a functional and efficient bar space and the upholstered stools make it comfy to hang out. ', 215.78);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(45, 'Blakes Rustic Industrial Console Table', 'No', 'Good', , 3, 'Featuring a rustic reclaimed look, the Blakes console table is constructed of antique black textured finish metal frame and distressed weathered oak finished plank wood board. The U-shaped base of console table is perfect for entryway to hold everyday belongings and cut the clutter in your home. The distressed finish over oak veneer adds vintage casual style for a unique accent console table in a living room, entry way, or dining room. The Blakes will be a standout piece for any home looking to add a touch of refined style. ', 200.36),
(46, 'Frigidaire 4 Piece Electric Kitchen Appliance Package - Stainless Stee', 'No', 'Good', , 2, 'When you are looking for new appliances, trust the experts that have put this Frigidaire 4 piece electric appliance package together for you. The air and water filter in the side-by-side refrigerator will keep your food tasting fresh and give you great-tasting water. With 5 cu ft in the oven of the electric range, you have room to cook your Thanksgiving turkey and more. The Frigidaire microwave features quick start options, helping you get dinner on the table quicker. And, finally, with the front control dishwasher, you can delay the start time and do the dishes on your own schedule. This appliance package gives you all you could want and more! ', 500.89),
(47, 'Summit 24\" Wide Built-In Compact Freezer - Stainless Steel ', 'No', 'Good', , 2, 'Summit\'s Model ALFZ53 is a 24\" wide all-freezer that can be paired with our AL54 all-refrigerator. Sized at just 32\" high, it can easily be installed under an ADA-compliant counter. This freezer features a jet-black cabinet and user-reversible stainless steel door with a pro-style handle. A factory-installed lock offers added security with two keys included. This unit comes with a front-breathing system that enables recessed built-in installation, while the fully finished exterior also allows freestanding use as needed.', 115.18),
(48, 'LG 23.8 cu ft Top Freezer Refrigerator - 33\"W Stainless Steel ', 'No', 'Good', , 2, 'Make the most out of a smaller space with this 33 inch With this refrigerator, you don\'t have to sacrifice features for space. You will still enjoy an internal water dispenser with filtered water, humidity-controlled drawers, and door bins that store your gallon-size containers. And, you get it all in an energy star refrigerator that will save you money and minimize the effect on the environment. ', 200.00);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(49, 'Samsung Bespoke 23 cu ft 4 door French Door Refrigerator - Counter Depth Blue and White Glass ', 'No', 'Good', , 2, 'This counter-depth Samsung 4-Door French Door Refrigerator features crisp morning blue glass and white glass front panels for a bright, clean design! With customizable compartments and temperature control, you\'ll be able to find the perfect fit for everything in your fridge. You will also enjoy the front beverage center with both a water dispenser and AutoFill water pitcher. In addition, a dual ice maker with cubed ice and ice bites gives you the perfect ice for every occasion. ', 250.86),
(50, 'Bosch Ascenta Front Control Dishwasher - White ', 'No', 'Good', , 2, 'This white Bosch Ascenta dishwasher from RC Willey will get your dishes sparkling clean, bacteria-free, and ready for dinner! The sanitize feature eliminates up to 99.9% of bacteria and meets NSF certification requirements for sanitization. In addition, the delay timer lets you run the dishwasher when it is convenient for you.', 100.98),
(51, 'Kitchenaid Top Control Dishwasher - Stainless Steel ', 'No', 'Good', , 2, 'With this Kitchenaid dishwasher from RC Willey, you can keep up with the tools you use from prep to table with three racks of versatile loading possibilities and complete wash coverage. The FreeFlex™ Third Rack fits glasses, mugs, bowls, silverware and cooking tools, freeing up room below for pots, plates and mixing bowls. Advanced Clean Water Wash System circulates clean water to dishes in all three racks, and the Fan-Enabled ProDry™ System provides thorough drying, so dishes come out ready for more enjoying. ', 199.99),
(52, 'Preston Pearl White Modular Armless Chair ', 'No', 'Good', , 2, 'The modular Preston collection blends exceptional comfort with a simplified silhouette for a look that is as stylish as it is laid back! Sure to be a modern classic, the plushly padded cushions and clean lines of this armless chair are covered in a durable pearl white polyester fabric that has the look and feel of Merino wool. Its modular design means it\'s easy to move and can be used as a stand-alone seating option or reconfigured with other pieces in the Preston collection to best meet the needs of your unique space! ', 105.89),
(53, 'Dark Chocolate Patio One - Seat Glider Chair ', 'No', 'Good', , 4, 'This dark chocolate patio one-seat glider is a durable and stylish choice for your patio, deck, or porch! With a metal frame, this mesh chair is built to last and withstand the outdoor elements. The sleek dark frame and dark sling look great with any style of patio furniture. Pair it with a patio table to create a relaxing dining area. ', 130.89);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(54, 'Fun Time 8 x 11 Solar System Multi-Color Area Rug ', 'No', 'Good', , 7, 'Memorize the planets or dream of future space exploration with this 8 x 11 large solar system multi-color area rug! There will be many hours of fun ahead with this perfect addition to your new playroom.', 30.89);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(55, '3 x 5 Small Travel Fun Multi-Color Area Rug - Fun Time ', 'No', 'Good', , 7, 'Take a trip across the USA with this 3 x 5 small travel fun multi-color area rug! Get out the toy cars and drive through the states for hours of learning and fun. It\'s the perfect addition to your new playroom.', 29.89),
(56, 'Spartan Gray Ottoman ', 'No', 'Good', , 1, 'Looking for the ideal place to really get comfortable? Look no further than the Spartan collection! This ottoman offers a plushly padded top, soft and durable upholstery, clean lines, and an approachable and chic contemporary design. ', 230.99);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(57, 'Dallas Brown Leather Ottoman ', 'No', 'Good', , 1, 'Comfort meets quality in the Dallas collection. This ottoman\'s handsome silhouette is covered in 100% full-grain Italian leather that features a wax and oil finish for easy cleaning and long-lasting beauty. Its rich and warm chestnut brown color sets a time-honored and welcoming backdrop for your family and friends to gather and put their feet up! ', 200.89),
(58, 'Right Side Facing Smoke Gray Upholstered Chaise Lounge - Ansel ', 'No', 'Good', , 6, 'With a half-open back, this right arm-facing, sleek gray chaise lounge from Scott\'s Furniture Barn will add a contemporary vibe to your home. Relax in style on the two-seat cushions as they provide a comfortable place to rest. This upholstered chaise will be an update to a living room or sitting room. ', 250.56),
(59, 'Jubilee Light Brown and Gray Queen Storage Bed ', 'No', 'Good', , 6, 'Effortless, enduring style abounds in the Jubilee collection! This queen size bed is sturdy crafted and features a fresh and inviting light brown finish with gray undertones that will effortlessly enhance a wide range or decorating tastes. It features chic gray upholstery along the top of the bed rails and with button tufting on the headboard and on the bench-style footboard. Compartments in the footboard make for easy storage or display.\r\n\r\nIncludes upholstered headboard, storage footboard with bench-style top, slats, and rails.\r\n', 290.56);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(60, 'Glacier Country Log Rocking Chair ', 'No', 'Good', , 7, 'Glacier Country Collection Log Rocking ChairHandcrafted by the Artisans of Northwestern Montana, this cozy solid pine rocking chair will ease your worries away with its gentle back and forth rocking motion. Built with the sturdiest construction methods available, the mortise and tenon joinery system, this log rocker embodies the meaning of \"heirloom quality\". You will be pleased with the lasting artistry and quality materials of this chair. ', 120.99),
(61, 'Edgewater Cream Outdoor Rocker', 'No', 'Good', , 7, 'Live your best moments on the Edgewater all weather rocker. Whether by sea or lake, it’s the perfect place to call your sanctuary. Clean metal lines and the comfort of the cushions offer a timeless look and quality you can’t beat. Features water resistance cushions and corrosion resistance powder-coated aluminum frames. Please note that our cushions are water-resistant and not waterproof. Cushions are made of reticulated foam and fibers which means water will run through them and dry easily and quickly. ', 115.57);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(62, 'Ephraim Geometric Blue Wool 9 x 12 Area Rug ', 'No', 'Good', , 1, 'Transform your décor with the hand-tufted Ephraim Area Rug in azure blue wool. The interplay of texture using a cut and loop pile, coupled with subtle striations of color, add interest and enhances the look of your room. Sturdy, reinforced cotton canvas backing protects the carpet and adds an extra layer of cushion. ', 100.59);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(63, 'Carlyle 9 x 12 Contemporary Ivory and Blue Runner', 'No', 'Good', , 6, 'These tonal colors bring out the beauty in natural contemporary design. The soft transition from deep blue to ivory makes this a rug that will easily fit anywhere in your home! The thick, plush polypropylene and polyester pile is powerloomed featuring a high and low effect, adding dimension and comfort to your home.', 60.96),
(64, 'Valencia Neela 9 x 12 Gray Wool Hand Tufted Area Rug', 'No', 'Good', , 1, 'Enter a world where the rug is the focal point of your décor where pattern and texture mingle in harmony. Hand-tufted by skilled artisans, these all-loop wool rugs are created in designs meant to be star attraction in your room. Sturdy, reinforced cotton canvas backing protects the carpet and adds an extra layer of cushion. ', 50.63),
(65, 'Luxury Grip 9 x 14 Rug Pad ', 'No', 'Good', , 1, 'This 9 x 14 X-Large Luxury Grip rug pad from RC WIlley is the ultimate in rug padding. It offers cushioned comfort and protection for both your rug and your floor. Reversible for use on hard surfaces and carpet. ', 25.99);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(66, '5 x 8 Medium Shell Taupe Braided Indoor-Outdoor Rug ', 'No', 'Good', , 4, 'The Sea Glass collection 5 x 8 medium shell taupe concentric rectangle braided indoor-outdoor rug is reversible for twice the wear. Add a touch of beachside beauty to indoor and outdoor venues.\r\n\r\n', 35.63),
(67, '5 x 8 Medium Smokey Quartz Gray Oval Braided Indoor-Outdoor Rug', 'No', 'Good', , 4, 'The Sea Glass collection 5 x 8 medium smokey quartz gray oval braided indoor-outdoor rug is reversible for twice the wear. Add a touch of beachside beauty to indoor and outdoor venues.', 35.63),
(68, 'Portofino Taupe Umbrella ', 'No', 'Good', , 4, 'Introducing our stylish and functional outdoor umbrella in taupe! Perfect for any outdoor space, this umbrella provides shade and protection from the sun\'s harmful rays. Made with high-quality materials, it is rust-resistant, fade-resistant, and water-repellant. Its taupe color adds a touch of sophistication to any outdoor decor. The umbrella is easy to assemble and features a user-friendly design. Whether you\'re lounging by the pool or enjoying a meal on the patio, this outdoor umbrella is a must-have for any outdoor space. ', 60.96);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(69, 'Turquoise Blue Square Patio Umbrella ', 'No', 'Good', , 4, '\r\nShare special moments in your own backyard with the PPU-360-U Patio Umbrella from CorLiving. Complete your outdoor dining area with the 6.5 ft. Square Patio Umbrella. This two-meter umbrella features air vents to help ensure that your seating area stays cool even on the sunniest of days. Its strong steel frame and durable, UV-resistant polyester fabric is made to last so you can enjoy the shade for years. Its convenient crank system makes is simple to store and assemble. ', 60.96),
(70, 'Outdoor Cast-Top Side Table & Umbrella Stand', 'No', 'Good', , 4, 'Hanover produces the best space-saving designs for your backyard retreat. The Traditions Cast-top Side Table adds a timeless look to any space and doubles as an umbrella stand without needing to purchase an additional umbrella base. This table includes a decorative cast-aluminum top and provides a convenient storage space for your beverages and snacks. The sides are polished with a protective bronze coating and stands out in any outdoor environment. ', 50.89);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(71, 'Outdoor Tan Umbrella', 'No', 'Good', , 4, 'The Traditions Market Umbrella allows you to make the most of your time outdoors from sunrise to sundown. This 9-foot umbrella is perfect for use with outdoor dining sets. It features an easy-crank lever that allows you to quickly open and close the canopy with ease. The pivot under the ribs offers an adjustable canopy tilt, keeping your guests cool and comfortable in the shade at any angle. The long-lasting fabric requires little maintenance and resists weathering and UV harm. It complements any outdoor setting in an elegant fashion with its lovely warm earth-tone and clean lines. ', 60.99),
(72, 'Red High Back Office Chair', 'No', 'Good', , 5, 'The modern high back red office chair is designed to lower the risk of long-term injuries caused by prolonged sitting.  The chair adjusts to the contours of your body when you are sitting still in addition to effortlessly maintaining comfort and ergonomics when you move around. The chair is perfect for home office or commercial offices ', 100.89),
(73, 'Grayson Cinder Gray Open Bookcase ', 'No', 'Good', , 5, 'Smartly styled with a Rustic design, this open display bookcase will be a staple in your home for years to come. Ideal for a home office, living room, bedroom or even kitchen, this piece adds storage and display space in your home without compromising style! ', 50.96);
INSERT INTO `items` (`ItemId`, `Name`, `featured`, `condition`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(74, 'Invisimat Glass 36\" x 46\" Chair Mat ', 'No', 'Good', , 5, 'Easily roll your office chair on this crystal clear invisimat! The tempered glass is five times stronger than standard glass, giving you stability you can count on. A unique beveled edge helps make sure you\'ve got a smooth ride transferring on or off the mat, so you never have to worry about getting a wheel stuck on the edge of your home office mat again. This crystal-clear chair mat will take your home office design to the next level! ', 15.89),
(75, 'Toulouse 4 Piece Two Tone Brown Bookcase Wall ', 'No', 'Good', , 5, 'This 4 piece two tone brown bookshelf wall from RC Willey will look fabulous in your home or office. With plenty of space for your books and favorite display pieces, you will love getting organized and moving your things onto this piece. Each shelf has one fixed shelf and four adjustable shelves giving you flexibility in your design. Purchase additional bookcases to easily add on to your library and add the matching desk to have a beautiful new home office makeover. ', 300.99);

